                              "before:prepare": function anonymous(
) {
this.parameters.color = 'black' ;

// Different Display #
// array of all possible cues
cues = new Array(0,1,2,3);

//remove lure
const lure = this.parameters.lure;
const lure_idx = cues.indexOf(lure);
if(lure_idx > -1){
  cues.splice(lure_idx,1); // remove
}

// remove totaldots
const totaldots = this.parameters.totaldots;
const totaldots_idx = cues.indexOf(totaldots);
if(totaldots_idx > -1){ 
  // if lure == totaldots, totaldots_index doesn't exists(-1)
  // because it's deleted already
  cues.splice(totaldots_idx,1);
}

// generate new array for display
arr = new Array();
if(lure == totaldots){
  // 2 elements drawn from array with replacement 
  arr.push(totaldots,this.random.choice(cues),this.random.choice(cues)); 
}else{
  arr.push(totaldots,lure, this.random.choice(cues));
}
//randomly select number from array to display
this.options.parameters.display = this.random.choice(arr);
console.log("this display number is ")
console.log(this.options.parameters.display)

//correct answer
if(this.options.parameters.instruction = "you"){
  this.options.parameters.correctanswer = totaldots;
}else{
  this.options.parameters.correctanswer = lure;
}

//create column for correct keypress 
if(this.options.parameters.display == this.options.parameters.correctanswer){
  this.options.parameters.correctkeypress = "h";
}else{
  this.options.parameters.correctkeypress = "j";
}

//count trial numbers
console.log(this.options.id.split('_'));
console.log(this.options.id.split('_').length);

this.options.parameters.trial_count = parseInt(this.options.id.split('_')[this.options.id.split('_').length-1])+1 ;
console.log(this.options.parameters.trial_count)


}
